import { Component, EventEmitter, Output, NgModule } from '@angular/core';
import { Router } from '@angular/router';
import { Person } from '../services/person'
import { formatDate } from '@angular/common';
import { UserService } from '../services/person.service';

@Component({
  selector: 'app-new-account',
  templateUrl: './new-account.component.html',
  styleUrls: ['./new-account.component.css']
})
export class NewAccountComponent {
  @Output() OnLoginClicked = new EventEmitter();
  router: Router;
  constructor(private service: UserService, router: Router) {
    this.router = router
  }

  protected password = '';
  protected rePassword = '';

  pessoinha : Person = {
    id : 0,
    name : '',
    birth : new Date,
    email : '',
    photo : '',
    password : '',
    salt : ''
  }

  // validatePassword(){
  //   this.password.
  // }

  checkPassword() {
    return this.password === this.rePassword
  }

  signInClicked(){
    console.log(this.pessoinha + 'OKAY');

    this.service
      .registerUser(this.pessoinha)
      .subscribe(response => {
        this.router.navigate('')
    })

  }
  loginClicked()
  {
    this.OnLoginClicked.emit();
  }
}
<div class="container">
  <div class="content">
    <h2>Create Account</h2>
    <div>
      <span id="image-input">
        <label for="profile-photo">Profile Photo</label>
        <button>
          <img src="../../assets/images/person-standard-logo.png" width="100" alt="Image Preview">
        </button>
        <input type="file"  [(ngModel)]="pessoinha.photo" id="profile-photo" accept="image/*">
      </span>
      <span>
        <label for="name">Name</label>
        <input id="name" [(ngModel)]="pessoinha.name" type="text" placeholder="Example Name" />
      </span>
      <span>
        <label for="email">Email</label>
        <input id="email"  [(ngModel)]="pessoinha.email" type="email" placeholder="example@domain.com" />
      </span>
      <span>
        <label for="pass">Password</label>
        <input id="pass"  [(ngModel)]="pessoinha.password" type="password" placeholder="********" minlength="8"/>
      </span>
      <span>
        <label for="re-pass">Confirm Password</label>
        <input id="re-pass" type="password" placeholder="********" />
      </span>
      <span>
        <label for="birth">Birthday</label>
        <input id="birth"  [(ngModel)]="pessoinha.birth" type="date" placeholder="dd/mm/yyyy" />
      </span>
      <div class="buttons">
        <button (click)="loginClicked()">Login</button>
        <button (click)="signInClicked()">Sign In</button>
      </div>
    </div>
  </div>
</div>
